import React from "react";
import "./skills.css";
import { 
  FaHtml5, 
  FaCss3Alt, 
  FaJs, 
  FaReact 
} from "react-icons/fa";
import { SiFigma, SiCanva } from "react-icons/si";

const Skills = () => {
  return (
    <section id="skills">
      <h2 className="skillTitle">Skills</h2>

      <div className="skillGrid">
        <div className="skillCard">
          <FaHtml5 className="icon html" />
          <p>HTML</p>
        </div>

        <div className="skillCard">
          <FaCss3Alt className="icon css" />
          <p>CSS</p>
        </div>

        <div className="skillCard">
          <FaJs className="icon js" />
          <p>JavaScript</p>
        </div>

        <div className="skillCard">
          <FaReact className="icon react" />
          <p>React</p>
        </div>

        <div className="skillCard">
          <SiFigma className="icon figma" />
          <p>Figma</p>
        </div>

        <div className="skillCard">
          <SiCanva className="icon canva" />
          <p>Canva</p>
        </div>
      </div>
    </section>
  );
};

export default Skills;
